import React from 'react';
import './App.css';
import MainLayout from './layouts/MainLayout';
import HomePage from './pages/HomePage';
import { EventProvider, useEventContext } from './contexts/EventContext';
import useWebSocket from './hooks/useWebSocket';

const API_BASE = "ws://localhost:3002/ws";

function App() {
  const { dispatch } = useEventContext();

  const { sendMessage } = useWebSocket(API_BASE, (message) => {
    dispatch({ type: 'ADD_EVENT', payload: message });
  });

  return (
    <MainLayout>
      <HomePage />
    </MainLayout>
  );
}

const Root = () => (
  <EventProvider>
    <App />
  </EventProvider>
);

export default Root;
